var CyberPro=function(){var gameName="CyberProGame";function init(newname){gameName=newname}function getGameName(){return gameName}function post(url,dataSent){fetch(url,{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify(dataSent)}).then(function(response){return response.json()}).then(function(json){console.log("Response",json)}).catch(function(ex){console.log("parsing failed "+ex)})}return{init:init,post:post,gameName:getGameName}}();